import React from 'react';
import PropTypes from 'prop-types';
import { connect } from 'react-redux';
import getEconomia from './api/economia';
import Header from '../components/Header';
import WalletForm from '../components/WalletForm';
import { addCoins } from '../redux/actions';

class Wallet extends React.Component {
  constructor() {
    super();

    this.state = {
      coinsObj: {},
    };
  }

  componentDidMount() {
    const coins = getEconomia();
    coins.then((response) => {
      delete response.USDT;
      const coinsWithoutUSDT = response;
      this.setState({ coinsObj: coinsWithoutUSDT }, () => {
        this.updateState();
      });
    });
  }

  updateState = () => {
    const { coinsObj } = this.state;
    console.log(Object.keys(coinsObj));
    const { dispatch } = this.props;
    dispatch(addCoins(Object.keys(coinsObj)));
  };

  render() {
    return (
      <div>
        <Header />
        <WalletForm />
      </div>
    );
  }
}
Wallet.propTypes = {
  dispatch: PropTypes.func.isRequired,
};

export default connect()(Wallet);
